import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonBackButton, IonCard, IonImg, IonCardHeader, IonCardSubtitle, IonCardTitle, IonCardContent } from '@ionic/react';

import './Tab3.css';
import axios from 'axios';

const RequestToMyApi = () => {
  return axios({
    url: 'http://localhost:25000/partidas',
    method: 'get'
  }).then(response => {
    return response.data;
  })
};

const Tab3: React.FC = () => {

  const [partida, setPartida] = React.useState([]);

  React.useEffect(() => {
    RequestToMyApi().then(data => setPartida(data))
  }, []);


  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>

            <IonButtons slot="start">
              <IonBackButton defaultHref='/' text='regresar' />
            </IonButtons>
          <IonTitle>Tab 3</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>

      {partida.map(({fechayhora, winorlose}, i) => ( 

          <IonCard  key={i}>
          <IonCardHeader>
      <IonCardSubtitle>{fechayhora}</IonCardSubtitle>
        <IonCardTitle></IonCardTitle>
          </IonCardHeader>

            <IonCardContent>

            </IonCardContent>
          </IonCard>

       ))
       }

      </IonContent>
    </IonPage>
  );
};

export default Tab3;
